
<!DOCTYPE html>
<html>
<head>
<meta charset="UTF-8">
<title>Nando's Deals</title>
<style>
body {
    font-family: Arial, sans-serif;
    background: linear-gradient(135deg, #0b1f3a, #b45309);
    padding:30px;
}
.container {
    max-width:900px;
    margin:auto;
    background:#0f2a4d;
    padding:25px;
    border-radius:14px;
    color:white;
}
.logo {
    text-align:center;
    margin-bottom:20px;
}
.logo img {
    max-width:300px;
}
.section-title {
    text-align:center;
    font-size:28px;
    margin:30px 0 15px;
}
.products {
    display:grid;
    grid-template-columns: 1fr;
    gap:20px;
}
.product {
    display:flex;
    gap:20px;
    background:#132f55;
    border-radius:12px;
    padding:15px;
    align-items:center;
}
.product img {
    width:220px;
    border-radius:10px;
}
.price {
    font-size:26px;
    font-weight:bold;
    color:#f97316;
}
form {
    background:#132f55;
    padding:20px;
    border-radius:12px;
}
input, select, textarea {
    width:100%;
    padding:12px;
    margin:8px 0;
    border-radius:6px;
    border:none;
}
button {
    width:100%;
    background:#f97316;
    color:#0b1f3a;
    padding:14px;
    border:none;
    border-radius:8px;
    font-size:18px;
    font-weight:bold;
}
</style>
</head>
